import {
  EncodedContent,
  Client,
  TextCodec,
  DecodedMessage
} from "@xmtp/xmtp-js";
import {
  FileContent,
  MessageObject,
  MessageType,
  ProposalContent,
  StringContent,
  SupportedFileMimeTypes,
  ThreadId
} from "../src/util/v0.0.1/definitions";
import { getAuthorityId } from "../src/util/v0.0.1/functions";
import { BosonCodec } from "../src/xmtp/codec/boson-codec";
import { Signer } from "ethers";

export function mockThreadId(random = false): ThreadId {
  return {
    exchangeId: random ? randomId() : "1",
    buyerId: random ? randomId() : "1",
    sellerId: random ? randomId() : "1"
  };
}

function randomId(): string {
  return Math.floor(Math.random() * 100).toString();
}

export function mockJsonString(): string {
  return '{"valid":"value"}';
}

export function mockEncodedContent(envName: string): EncodedContent {
  const bosonCodec: BosonCodec = new BosonCodec(envName);
  const validContent: string = mockJsonString();
  return bosonCodec.encode(validContent);
}

export async function testXmtpClient(
  signer: Signer,
  envName: string
): Promise<Client> {
  return await Client.create(signer, {
    env: envName === "production" ? "production" : "dev",
    codecs: [new TextCodec(), new BosonCodec(envName)]
  });
}

export function nullAddress(): string {
  return "0x0000000000000000000000000000000000000000";
}

export function mockMessageObject(
  type: MessageType,
  threadId?: ThreadId
): MessageObject {
  let content: StringContent | FileContent | ProposalContent;
  switch (type) {
    case MessageType.String:
      content = {
        value: mockJsonString()
      };
      break;
    case MessageType.File:
      content = mockEncodedFilePdf();
      break;
    case MessageType.Proposal:
      content = mockProposal();
      break;
    default:
      content = null as unknown as StringContent;
  }
  return {
    threadId: threadId ? threadId : mockThreadId(),
    contentType: type,
    version: "0.0.1",
    content: content
  };
}

export function mockXmtpMessage(envName: string): DecodedMessage {
  return {
    contentType: {
      authorityId: getAuthorityId(envName)
    },
    content: mockJsonString()
  } as DecodedMessage;
}

